%script

BEGIN EXECUTE IMMEDIATE 'DROP TABLE LATEST_POTENTIAL_CHURNERS';
      EXCEPTION WHEN OTHERS THEN NULL; 
END;

%sql

SELECT * FROM LATEST_POTENTIAL_CHURNERS SAMPLE(1)
         ORDER BY PROB_CHURN DESC;

%script

